using namespace std;


bool is_simple(int number) {
	for (int i = 2; i < number / 2; i++) {
		if (number % i == 0) {
			return false; // число не является простым
		}
	}
	return true; // число является простым
}

int main() {

	setlocale(LC_ALL, "ru");

	int n;
	cout << "Введите число: ";
	cin >> n;
	cout << "Число является простым: " << is_simple(n) << endl;
}

#include <iostream>
#include <time.h>   // для time()
#include <stdlib.h> // для rand()

using namespace std;


int fact(int number) {
	int result = 1;
	for (int i = 1; i <= number; i++) {
		result *= i;
	}
	return result;
}

int main() {

	setlocale(LC_ALL, "ru");

	int n;
	cout << "Введите число: ";
	cin >> n;
	cout << "Факториал числа: " << fact(n) << endl;
}

#include <iostream>
#include <time.h>   // для time()
#include <stdlib.h> // для rand()

using namespace std;


void print_rectangle(int H, int W) { // H - высота, W - ширина
	for (int i = 0; i < H; i++) {
		for (int j = 0; j < W; j++) {
			if (i == 0 || i == H - 1 || j == 0 || j == W - 1) {
				cout << '*';
			}
			else {
				cout << " ";
			}
		}
		cout << endl;
	}
}


int main() {

	setlocale(LC_ALL, "ru");

	int N, K;
	cout << "Введите ширину: ";
	cin >> K;
	cout << "Введите высоту: ";
	cin >> N;
	print_rectangle(N, K);
}
